INSERT INTO `question` VALUES (1,'Le cours est bien équilibré entre éléments de théorie, exemples et applications.',1),(2,'Le déroulement des cours, TD, TP refléte la difficulté et l’importance des sujets traités.',1),(3,'Le volume horaire refléte l’importance de la matiére.',1),(4,'Le contenu du cours est satisfaisant pour mon orientation professionnelle.',2),(5,'J’ai compris les objectifs et l’importance de ce cours.',2),(6,'Les ressources nécessaires me semblent appropriées et disponibles.',2),(7,'J’ai compris quels sont les criteres et directives de ces activites.',3),(8,'Je sais quels sont les objectifs evalues par ces activites',3),(9,'Ces activités me permettent de vérifier ma progression',3),(10,'L’enseignant présente la matiére de façon claire et structurée.',4),(11,'L’enseignant est suffisamment disponible.',4),(12,'L’enseignant semble socieux d`améliorer son cours ',4),(13,'Les activités proposées pendant le cours ont nécessité votre participation active.',5),(14,'Le groupe était dynamique et participait volontiers aux activités, répondait aux questions.',5),(15,'Les méthodes d\'enseignement vous ont permis d\'acquérir les compétences visées',5),(16,'Les modalité d\'évaluation ont été clairement présentées.',6),(17,'Les consignes pour la réalisation des travaux de l\'évaluation des compétences étaient claires',6),(18,'Des retours utiles ont été faits à propos des travaux et examens',6);
